INSERT INTO `v1_47e1ef47d46236a7e132d5e7422a9f165e1e236b083f6b28132288caca430b44` VALUES (0, 10, "上出来、上出来。\nさて、絵も完成したことだし、\nみんなでパパっと片づけをして\n食事にでも行くとするかい。", 105611, 11, 1, 14112, 0.5, 14112030, 1, 0);
