INSERT INTO `v1_47e1ef47d46236a7e132d5e7422a9f165e1e236b083f6b28132288caca430b44` VALUES (0, 10, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 102711, 11, 1, 16612, 0.5, 16612031, 1, 0);
