INSERT INTO `v1_47e1ef47d46236a7e132d5e7422a9f165e1e236b083f6b28132288caca430b44` VALUES (0, 10, "クスクス……違います。\nこれはあのおかたへの愛……\n枯れることのない、永遠の愛が\nテーマですわ……", 102711, 11, 1, 18812, 0.5, 18812036, 1, 0);
