INSERT INTO `v1_47e1ef47d46236a7e132d5e7422a9f165e1e236b083f6b28132288caca430b44` VALUES (0, 10, "そ、そうですね……\nそんなきれいな風景の中で、\nただ一人辱めを受けている\n自分とかを想像すると……じゅるり♪", 104511, 11, 1, 23812, 0.5, 23812031, 1, 0);
