INSERT INTO `v1_47e1ef47d46236a7e132d5e7422a9f165e1e236b083f6b28132288caca430b44` VALUES (0, 10, "オー、まさに陰と陽！\nこれがゲージュツの分野で\nいうところの、コントラストと\nいうヤツなのでショウか？", 103011, 11, 1, 23812, 0.5, 23812036, 1, 0);
